import React, { Component } from 'react';

type Props = {
  appState: any,
  setView: any,
}

enum Views {
  account = 'ACCOUNT'
  , register = 'REGISTER'
}

export default class Login extends Component<Props> {
  render() {
    const { setView } = this.props;
    const { account, register } = Views;

    return (
      <div className='login-component'>
        <div className='login'>
          <h1>Login</h1>
          <div className='main'>
            <input className="login-input" type="text" name="name" placeholder="Username" />
            <input className="login-input" type="text" name="name" placeholder="Password" />
            <div
              className="login-button"
              role="button"
              onKeyUp={() => setView(account)}
              onClick={() => setView(account)}
            >Log In</div>
            <p>Not registered yet. Register now.</p>
            <div
              className="login-button"
              role="button"
              onKeyUp={() => setView(register)}
              onClick={() => setView(register)}
            >Register</div>
          </div>
        </div>
      </div>
    );
  }
}
